package _028_ImplementStrStr;

import static org.junit.Assert.*;

import org.junit.After;
import org.junit.Before;
import org.junit.Rule;
import org.junit.Test;
import org.junit.rules.Timeout;

public class SolutionTest {

    /** Test method for {@link _028_ImplementStrStr.Solution } */
    Solution solution;

    @Rule
    public Timeout globalTimeout = new Timeout(20);

    @Before
    public void setUp() throws Exception {
        solution = new Solution();
    }

    @After
    public void tearDown() throws Exception {
        solution = null;
    }

    @Test
    public void Test1() {
        String haystack = "needle";
        String needle = "needle";
        int actual = solution.strStr(haystack, needle);
        int expected = 0;
        assertEquals(needle + " in " + haystack, expected, actual);
    }

    @Test
    public void Test2() {
        String haystack = "nnneedle";
        String needle = "needle";
        int actual = solution.strStr(haystack, needle);
        int expected = 2;
        assertEquals(needle + " in " + haystack, expected, actual);
    }

    @Test
    public void Test3() {
        String haystack = "neeneedle";
        String needle = "needle";
        int actual = solution.strStr(haystack, needle);
        int expected = 3;
        assertEquals(needle + " in " + haystack, expected, actual);
    }

    @Test
    public void Test4() {
        String haystack = "neeneedleneedle";
        String needle = "needle";
        int actual = solution.strStr(haystack, needle);
        int expected = 3;
        assertEquals(needle + " in " + haystack, expected, actual);
    }

    @Test
    public void Test5() {
        String haystack = "neeneedlenee";
        String needle = "needle";
        int actual = solution.strStr(haystack, needle);
        int expected = 3;
        assertEquals(needle + " in " + haystack, expected, actual);
    }

    @Test
    public void Test6() {
        String haystack = "nenedlenee";
        String needle = "needle";
        int actual = solution.strStr(haystack, needle);
        int expected = -1;
        assertEquals(needle + " in " + haystack, expected, actual);
    }

    @Test
    public void Test7() {
        String haystack = "";
        String needle = "";
        int actual = solution.strStr(haystack, needle);
        int expected = -1;
        assertEquals(needle + " in " + haystack, expected, actual);
    }

    @Test
    public void Test8() {
        String haystack = "";
        String needle = "";
        int actual = solution.strStr(haystack, needle);
        int expected = 0;
        assertEquals(needle + " in " + haystack, expected, actual);
    }
}
